import React, {useState} from 'react'

const AddCategory = () => {

    const [inputValue, setInputValue] = useState("Ingresar nueva categoria ")



    return (
        <>
            <h1>{inputValue}</h1>
            <input 
            type="text"
            value={inputValue}
            onChange={(e)=>setInputValue(e.target.value)}

            />
        </>
    )
}

export default AddCategory
